description:
NASCAR 2012 Sprint Cup Series Race #35 Phoenix AdvoCare 500 in 720p HD [CARG]

**SPLIT FILES FULL RACE** These files were ripped from YouTube and credit should go to uploader LuisAlbertoPerez2008 . Contains the watermark LP2008 in the upper left hand corner. It is the full race commercial free.
After playing with encoding options, I never found a setting I feel comfortable with so I am just adding the raw split files as a whole in 720p HD. 

Please seed at full speed during and after download so that others can also enjoy and be sure to check out other CARG releases.


File Type: Mp4
Video Codec: H264 - MPEG-4-AVC (part10)(avc1)
Resolution: 1280x720
Frame Rate: 30
Audio Codec: MPEG AAC Audio(mp4a)
Channels: Stereo
Sample Rate: 44100 Hz
Run Time: APPROX 4hrs
Tested with VLC on PC and WDTV Media Player on T.V.

